/**
 * @title MocCommons
 * @dev To bypass the 24kb size limitation on MocCore we use MocCoreExpansion contract. Some functions
 *  are implemented there and MocCore delegates calls to it. To achieve that, we need both to have the
 *  exact same storage layout and be able to access the same common functions.
 *  MocCommons contract serves as the last shared ancestor in the line of inheritance for them,
 *  and all storage variables must be either declared here or in a parent contract.
 *  Declaring variables after this point could result in storage collisions.
 */
abstract contract MocCommons is MocEma {
    // ------- Storage -------

    // Address for MocVendors contract, provides fee markup information
    MocVendors public mocVendors;

    // ------- Internal Structs -------

    struct MintTCandTPParams {
        address tp;
        uint256 qTP;
        uint256 qACmax;
        address sender;
        address recipient;
        address vendor;
    }

    struct RedeemTCandTPParams {
        address tp;
        uint256 qTC;
        uint256 qTP;
        uint256 qACmin;
        address sender;
        address recipient;
        address vendor;
    }

    struct SwapTPforTPParams {
        address tpFrom;
        address tpTo;
        uint256 qTP;
        uint256 qTPmin;
        uint256 qACmax;
        address sender;
        address recipient;
        address vendor;
    }

    struct SwapTPforTCParams {
        address tp;
        uint256 qTP;
        uint256 qTCmin;
        uint256 qACmax;
        address sender;
        address recipient;
        address vendor;
    }

    struct SwapTCforTPParams {
        address tp;
        uint256 qTC;
        uint256 qTPmin;
        uint256 qACmax;
        address sender;
        address recipient;
        address vendor;
    }

    struct RedeemTPParams {
        address tp;
        uint256 qTP;
        uint256 qACmin;
        address sender;
        address recipient;
        address vendor;
    }

    struct FeeCalcs {
        uint256 qACFee;
        uint256 qFeeToken;
        uint256 qACVendorMarkup;
        uint256 qFeeTokenVendorMarkup;
    }

    // ------- Custom Errors -------

    error PeggedTokenAlreadyAdded();
    error InsufficientTPtoRedeem(uint256 qTP_, uint256 tpAvailableToRedeem_);
    error TransferFailed();
    error OnlyWhenLiquidated();
    error InsufficientQacSent(uint256 qACsent_, uint256 qACNeeded_);
    error InsufficientTPtoMint(uint256 qTP_, uint256 tpAvailableToMint_);
    error QtpBelowMinimumRequired(uint256 qTPmin_, uint256 qTP_);
    error QtcBelowMinimumRequired(uint256 qTCmin_, uint256 qTC_);
    error QacNeededMustBeGreaterThanZero();
    error InsufficientTCtoRedeem(uint256 qTC_, uint256 tcAvailableToRedeem_);
    error MissingProviderData(address dataProviderAddress_);
    error MaxFluxCapacitorOperationReached(uint256 max_, uint256 new_);
    error InvalidFluxCapacitorOperation();
    error InsufficientQtpSent(uint256 qTPsent_, uint256 qTPNeeded_);
    error QacBelowMinimumRequired(uint256 qACmin_, uint256 qACtoRedeem_);

    // ------- Events -------

    event LiqTPRedeemed(
        address indexed tp_,
        address indexed sender_,
        address indexed recipient_,
        uint256 qTP_,
        uint256 qAC_
    );
    event PeggedTokenChange(uint256 i_, PeggedTokenParams peggedTokenParams_);

    // ------- Initializer -------

    /**
     * @notice contract initializer
     * @param mocVendors_ address for MocVendors contract.
     */
    function __MocCommons_init_unchained(address mocVendors_) internal onlyInitializing {
        mocVendors = MocVendors(mocVendors_);
    }

    // ------- Internal Functions -------

    /**
     * @notice calc fees amount in qAC or Fee Token
     *  If `sender_` has enough Fee Token to pay fees, will be used. In another case will use qAC
     * @dev if qFeeToken > 0, qACFee = 0. If qACFee > 0, qFeeToken = 0.
     * @param sender_ address who executes the operation
     * @param qAC_ amount of AC involved in the operation, could be sent form sender for mint or
     *  sent to recipient for redeem [N]
     * @param qACFeePct_ additional fee pct applied on operation
     * @return qACSurcharges amount of AC needed to pay fees and markup. 0 if pays with Fee Token
     * @return qFeeTokenTotalNeeded amount of Fee Token needed to pay fees and markup. 0 if pays with AC
     * @return feeCalcs
     * @dev
     *      qACFee amount of AC needed to pay fees
     *      qFeeToken amount of Fee Token needed to pay fess
     *      qACVendorMarkup amount of AC needed to pay vendor markup
     *      qFeeTokenVendorMarkup amount of Fee Token needed to pay vendor markup
     */
    function _calcFees(
        address sender_,
        address vendor_,
        uint256 qAC_,
        uint256 qACFeePct_
    ) internal view returns (uint256 qACSurcharges, uint256 qFeeTokenTotalNeeded, FeeCalcs memory feeCalcs) {
        uint256 qACmarked = 0;
        if (vendor_ != address(0)) {
            // [PREC] = [N] * [PREC]
            qACmarked = qAC_ * mocVendors.vendorMarkup(vendor_);
        }
        uint256 senderAllowance = feeToken.allowance(sender_, address(this));
        if (senderAllowance > 0) {
            (uint256 feeTokenPrice, bool hasFeeTokenPrice) = _peekPrice(feeTokenPriceProvider);
            if (hasFeeTokenPrice) {
                // calculates Fee Token to be charged as fee
                // [N] = ([N] * [PREC] * [PREC] / [PREC]) / [PREC]
                feeCalcs.qFeeToken = _mulPrec(qAC_ * qACFeePct_, feeTokenPct) / feeTokenPrice;
                if (qACmarked > 0) {
                    // [N] = [N] * [PREC] / [PREC]
                    feeCalcs.qFeeTokenVendorMarkup = qACmarked / feeTokenPrice;
                    // [N] = [N] + [N]
                    qFeeTokenTotalNeeded = feeCalcs.qFeeToken + feeCalcs.qFeeTokenVendorMarkup;
                } else {
                    qFeeTokenTotalNeeded = feeCalcs.qFeeToken;
                }
                if (senderAllowance < qFeeTokenTotalNeeded || feeToken.balanceOf(sender_) < qFeeTokenTotalNeeded) {
                    feeCalcs.qFeeToken = 0;
                    feeCalcs.qFeeTokenVendorMarkup = 0;
                    qFeeTokenTotalNeeded = 0;
                }
            }
        }
        // if sender hasn't got enough feeToken balance or allowance or price provider hasn't got a valid price
        // then qFeeToken == 0 and sender pays fees with AC
        // slither-disable-next-line incorrect-equality
        if (feeCalcs.qFeeToken == 0) {
            // calculates qAC to be charged as fee
            // [N] = [N] * [PREC] / [PREC]
            feeCalcs.qACFee = _mulPrec(qAC_, qACFeePct_);
            if (qACmarked > 0) {
                // [N] = [PREC] / [PREC]
                feeCalcs.qACVendorMarkup = qACmarked / PRECISION;
                // [N] = [N] + [N]
                qACSurcharges = feeCalcs.qACFee + feeCalcs.qACVendorMarkup;
            } else {
                qACSurcharges = feeCalcs.qACFee;
            }
        }
        return (qACSurcharges, qFeeTokenTotalNeeded, feeCalcs);
    }

    /**
     * @notice evaluates if there are enough Pegged Token available to mint, reverts if it`s not
     * @param i_ Pegged Token index
     * @param qTP_ amount of Pegged Token to mint [N]
     * @param pACtp_ Pegged Token price [PREC]
     * @param ctargemaCA_ target coverage adjusted by the moving average of the value of the Collateral Asset [PREC]
     * @param lckAC_ amount of Collateral Asset locked by Pegged Token [PREC]
     * @param nACgain_ amount of collateral asset to be distributed during settlement [N]
     */
    function _evalTPavailableToMint(
        uint256 i_,
        uint256 qTP_,
        uint256 pACtp_,
        uint256 ctargemaCA_,
        uint256 lckAC_,
        uint256 nACgain_
    ) internal view {
        uint256 ctargemaTP = _getCtargemaTP(i_, pACtp_);
        uint256 tpAvailableToMint = _getTPAvailableToMint(ctargemaCA_, ctargemaTP, pACtp_, lckAC_, nACgain_);
        // check if there are enough TP available to mint
        if (tpAvailableToMint < qTP_) revert InsufficientTPtoMint(qTP_, tpAvailableToMint);
    }

    /**
     * @notice evaluates if there is enough Collateral Token available to redeem, reverts if there's not
     * @param qTC_ amount of Collateral Token to redeem [N]
     * @param ctargemaCA_ target coverage adjusted by the moving average of the value of the Collateral Asset [PREC]
     * @param lckAC_ amount of Collateral Asset locked by Pegged Token [PREC]
     * @param nACgain_ amount of Collateral Asset that will be distributed at
     *         settlement because Pegged Token devaluation [N]
     */
    function _evalTCAvailableToRedeem(
        uint256 qTC_,
        uint256 ctargemaCA_,
        uint256 lckAC_,
        uint256 nACgain_
    ) internal view {
        uint256 tcAvailableToRedeem = _getTCAvailableToRedeem(ctargemaCA_, lckAC_, nACgain_);
        // check if there are enough TC available to redeem
        if (tcAvailableToRedeem < qTC_) revert InsufficientTCtoRedeem(qTC_, tcAvailableToRedeem);
    }

    /**
     * @notice ask to oracles for flux capacitor settings
     * @return absolute maximum transaction allowed for a certain number of blocks
     * @return differential maximum transaction allowed for a certain number of blocks
     */
    function _peekFluxCapacitorSettings() internal view returns (uint256, uint256) {
        bytes32 maxAbsoluteOp;
        bytes32 maxOpDiff;
        bool has;
        // get max absolute operation
        IDataProvider dataProvider = maxAbsoluteOpProvider;
        (maxAbsoluteOp, has) = dataProvider.peek();
        if (!has) revert MissingProviderData(address(dataProvider));
        // get max operational difference
        dataProvider = maxOpDiffProvider;
        (maxOpDiff, has) = dataProvider.peek();
        if (!has) revert MissingProviderData(address(dataProvider));
        return (uint256(maxAbsoluteOp), uint256(maxOpDiff));
    }

    /**
     * @notice returns lineal decay factor
     * @param blocksAmount_ amount of blocks to ask for the decay
     * @return newAbsoluteAccumulator absolute accumulator updated by lineal decay factor [N]
     * @return newDifferentialAccumulator differential accumulator updated by lineal decay factor [N]
     */
    function _calcAccWithDecayFactor(
        uint256 blocksAmount_
    ) internal view returns (uint256 newAbsoluteAccumulator, int256 newDifferentialAccumulator) {
        unchecked {
            // [N] = [N] - [N]
            uint256 blocksElapsed = block.number + blocksAmount_ - lastOperationBlockNumber;
            // [PREC] = [N] * [PREC] / [N]
            uint256 blocksRatio = (blocksElapsed * PRECISION) / decayBlockSpan;
            if (blocksRatio >= ONE) return (0, 0);
            uint256 decayFactor = ONE - blocksRatio;
            // [N] = [N] * [PREC] / [PREC]
            newAbsoluteAccumulator = (absoluteAccumulator * decayFactor) / PRECISION;
            // [N] = [N] * [PREC] / [PREC]
            newDifferentialAccumulator = (differentialAccumulator * int256(decayFactor)) / int256(PRECISION);
            return (newAbsoluteAccumulator, newDifferentialAccumulator);
        }
    }

    /**
     * @notice common function used to update accumulators during a TP operation
     *  reverts if not allowed
     * @dev the only difference between a redeem and a mint operation is that in the first one,
     * the qAC is subtracted on newDifferentialAccumulator instead of added
     * @param qAC_ amount of Collateral Asset used to mint
     * @param redeemFlag_ true if it is a redeem TP operation
     */
    function _updateAccumulators(uint256 qAC_, bool redeemFlag_) internal {
        (uint256 maxAbsoluteOperation, uint256 maxOperationalDifference) = _peekFluxCapacitorSettings();
        (uint256 newAbsoluteAccumulator, int256 newDifferentialAccumulator) = _calcAccWithDecayFactor(0);
        unchecked {
            newAbsoluteAccumulator += qAC_;
            int256 qACInt = int256(qAC_);
            if (redeemFlag_) qACInt = -qACInt;
            newDifferentialAccumulator += qACInt;
            // cannot underflow, always newDifferentialAccumulator <= newAbsoluteAccumulator
            uint256 operationalDifference = newAbsoluteAccumulator - SignedMath.abs(newDifferentialAccumulator);
            if (newAbsoluteAccumulator > maxAbsoluteOperation) {
                if (qAC_ > maxAbsoluteOperation) revert InvalidFluxCapacitorOperation();
                revert MaxFluxCapacitorOperationReached(maxAbsoluteOperation, newAbsoluteAccumulator);
            }
            if (operationalDifference > maxOperationalDifference)
                revert MaxFluxCapacitorOperationReached(maxOperationalDifference, operationalDifference);
            // update storage
            absoluteAccumulator = newAbsoluteAccumulator;
            differentialAccumulator = newDifferentialAccumulator;
            lastOperationBlockNumber = block.number;
        }
    }

    /**
     * @notice update accumulators during a mint TP operation
     *  reverts if not allowed
     * @param qAC_ amount of Collateral Asset used to mint
     */
    function _updateAccumulatorsOnMintTP(uint256 qAC_) internal {
        _updateAccumulators(qAC_, false);
    }

    /**
     * @notice update accumulators during a redeem operation
     *  reverts if not allowed
     * @param qAC_ reserve amount used for redeem
     */
    function _updateAccumulatorsOnRedeemTP(uint256 qAC_) internal {
        _updateAccumulators(qAC_, true);
    }

    /**
     * @notice internal common function used to calc max AC allowed to mint or redeem TP
     *  due to accumulators
     * // TODO: move this function to a MocView contract
     * @param newAbsoluteAccumulator_ absolute accumulator updated by lineal decay factor [N]
     * @param a_ on mint = AA - DA ; on redeem = AA + DA
     * @param b_ on mint = AA + DA ; on redeem = AA - DA
     * @return maxQAC minimum regarding maxAbsoluteOperation and maxOperationalDifference
     */
    function _calcMaxQACToOperateTP(
        uint256 newAbsoluteAccumulator_,
        uint256 a_,
        uint256 b_
    ) internal view returns (uint256 maxQAC) {
        (uint256 maxAbsoluteOperation, uint256 maxOperationalDifference) = _peekFluxCapacitorSettings();
        if (newAbsoluteAccumulator_ >= maxAbsoluteOperation) return 0;
        uint256 absoluteAccAllowed = maxAbsoluteOperation - newAbsoluteAccumulator_;

        if (a_ <= maxOperationalDifference) return absoluteAccAllowed;
        if (b_ >= maxOperationalDifference) return 0;
        uint256 differentialAccAllowed = (maxOperationalDifference - b_) / 2;
        return Math.min(absoluteAccAllowed, differentialAccAllowed);
    }

    /**
     * @notice gets the max amount of AC allowed to operate to mint TP with, restricted by accumulators
     * // TODO: move this function to a MocView contract
     * @return maxQAC minimum regarding maxAbsoluteOperation and maxOperationalDifference
     */
    function maxQACToMintTP() external view returns (uint256 maxQAC) {
        (uint256 newAbsoluteAccumulator, int256 newDifferentialAccumulator) = _calcAccWithDecayFactor(1);
        // X = mint amount
        // (AA + X) - |DA + X| <= MODA && X >= 0
        // 1) if DA + X >= 0 ---> AA + X - DA - X <= MODA ---> AA - DA <= MODA
        // 2) if DA + X < 0 ---> X <= (MODA - (AA + DA)) / 2

        // AA >= |DA|
        uint256 a = uint256(int256(newAbsoluteAccumulator) - newDifferentialAccumulator);
        uint256 b = uint256(int256(newAbsoluteAccumulator) + newDifferentialAccumulator);
        return _calcMaxQACToOperateTP(newAbsoluteAccumulator, a, b);
    }

    /**
     * @notice gets the max amount of AC allowed to operate to redeem TP with, restricted by accumulators
     * // TODO: move this function to a MocView contract
     * @return maxQAC minimum regarding maxAbsoluteOperation and maxOperationalDifference
     */
    function maxQACToRedeemTP() external view returns (uint256 maxQAC) {
        (uint256 newAbsoluteAccumulator, int256 newDifferentialAccumulator) = _calcAccWithDecayFactor(1);
        // X = redeem amount
        // (AA + X) - |DA - X| <= MODA && X >= 0
        // 1) if DA - X < 0 ---> AA + X + DA - X <= MODA ---> AA + DA <= MODA
        // 2) if DA - X >= 0 ---> X <= (MODA - (AA - DA)) / 2

        // AA >= |DA|
        uint256 a = uint256(int256(newAbsoluteAccumulator) + newDifferentialAccumulator);
        uint256 b = uint256(int256(newAbsoluteAccumulator) - newDifferentialAccumulator);
        return _calcMaxQACToOperateTP(newAbsoluteAccumulator, a, b);
    }

    /**
     * @dev This empty reserved space is put in place to allow future versions to add new
     * variables without shifting down storage in the inheritance chain.
     * See https://docs.openzeppelin.com/contracts/4.x/upgradeable#storage_gaps
     */

    // Purposely left unused to save some state space to allow for future upgrades
    // slither-disable-next-line unused-state
    uint256[50] private __gap;
}
","keccak256":"0x3d0e52c5f03867ae551825f0e3aafee08f86742ddfddd33e4651ac1e55849faf","license":"UNLICENSED"},"contracts/core/MocCore.sol":{"content":"// SPDX-License-Identifier: UNLICENSED
pragma solidity 0.8.20;

import { MocCommons, PeggedTokenParams, MocVendors } from "./MocCommons.sol";
import { MocCoreExpansion } from "./MocCoreExpansion.sol";
import { Address } from "@openzeppelin/contracts/utils/Address.sol";
import { SafeERC20 } from "@openzeppelin/contracts/token/ERC20/utils/SafeERC20.sol";

/**
 * @title MocCore
 * @notice MocCore nucleates all the basic MoC functionality and tool set. It allows Collateral
 * asset aware contracts to implement the main mint/redeem operations.
 */
abstract contract MocCore is MocCommons {
    // ------- Events -------
    event SuccessFeeDistributed(uint256 mocGain_, uint256[] tpGain_);
    event SettlementExecuted();
    event TCInterestPayment(uint256 interestAmount_);
    // ------- Custom Errors -------
    error MissingBlocksToSettlement();
    error MissingBlocksToTCInterestPayment();
    // ------- Structs -------

    struct InitializeCoreParams {
        InitializeBaseBucketParams initializeBaseBucketParams;
        // The address that will define when a change contract is authorized
        address governorAddress;
        // The address that is authorized to pause this contract
        address pauserAddress;
        // Moc Core Expansion contract address
        address mocCoreExpansion;
        // amount of blocks to wait between Pegged ema calculation
        uint256 emaCalculationBlockSpan;
        // address for MocVendors
        address mocVendors;
    }

    // ------- Storage -------
    // Moc Core Expansion contract address, used to expand 24kb size limit
    address internal mocCoreExpansion;

    // ------- Initializer -------
    /**
     * @notice contract initializer
     * @dev this function must be execute by the AC implementation at initialization
     * @param initializeCoreParams_ contract initializer params
     *        governorAddress The address that will define when a change contract is authorized
     *        pauserAddress_ The address that is authorized to pause this contract
     *        mocCoreExpansion Moc Core Expansion contract address
     *        feeTokenAddress Fee Token contract address
     *        feeTokenPriceProviderAddress Fee Token price provider contract address
     *        tcTokenAddress Collateral Token contract address
     *        mocFeeFlowAddress Moc Fee Flow contract address
     *        mocAppreciationBeneficiaryAddress Moc appreciation beneficiary address
     *        protThrld protected state threshold [PREC]
     *        liqThrld liquidation coverage threshold [PREC]
     *        feeRetainer pct retain on fees to be re-injected as Collateral, while paying fees with AC [PREC]
     *        tcMintFee additional fee pct applied on mint Collateral Tokens operations [PREC]
     *        tcRedeemFee additional fee pct applied on redeem Collateral Tokens operations [PREC]
     *        swapTPforTPFee additional fee pct applied on swap a Pegged Token for another Pegged Token [PREC]
     *        swapTPforTCFee additional fee pct applied on swap a Pegged Token for Collateral Token [PREC]
     *        swapTCforTPFee additional fee pct applied on swap Collateral Token for a Pegged Token [PREC]
     *        redeemTCandTPFee additional fee pct applied on redeem Collateral Token and Pegged Token [PREC]
     *        mintTCandTPFee additional fee pct applied on mint Collateral Token and Pegged Token [PREC]
     *        feeTokenPct pct applied on the top of the operation`s fee when using
     *          Fee Token as fee payment method [PREC]
     *        successFee pct of the gain because Pegged Tokens devaluation that is transferred
     *          in Collateral Asset to Moc Fee Flow during the settlement [PREC]
     *        appreciationFactor pct of the gain because Pegged Tokens devaluation that is returned
     *          in Pegged Tokens to appreciation beneficiary during the settlement [PREC]]
     *        bes number of blocks between settlements
     *        tcInterestCollectorAddress TC interest collector address
     *        tcInterestRate pct interest charged to TC holders on the total collateral in the protocol [PREC]
     *        tcInterestPaymentBlockSpan amount of blocks to wait for next TC interest payment
     *        maxAbsoluteOpProviderAddress max absolute operation provider address
     *        maxOpDiffProviderAddress max operation difference provider address
     *        decayBlockSpan number of blocks that have to elapse for the linear decay factor to be 0
     *        emaCalculationBlockSpan amount of blocks to wait between Pegged ema calculation
     *        mocVendors address for MocVendors contract.
     */
    function __MocCore_init(InitializeCoreParams calldata initializeCoreParams_) internal onlyInitializing {
        mocCoreExpansion = initializeCoreParams_.mocCoreExpansion;
        __MocUpgradable_init(initializeCoreParams_.governorAddress, initializeCoreParams_.pauserAddress);
        __MocBaseBucket_init_unchained(initializeCoreParams_.initializeBaseBucketParams);
        __MocEma_init_unchained(initializeCoreParams_.emaCalculationBlockSpan);
        __MocCommons_init_unchained(initializeCoreParams_.mocVendors);
    }

    // ------- Internal abstract Functions -------

    /**
     * @notice transfer Collateral Asset
     * @dev this function must be overridden by the AC implementation
     *  and revert if transfer fails.
     * IMPORTANT: if ac transfer could trigger custom gas consumption for the Collateral
     * used (like coinbase fallback or ERC777), gasLimit should be capped
     * @param to_ address who receives the Collateral Asset
     * @param amount_ amount of Collateral Asset to transfer
     */
    function acTransfer(address to_, uint256 amount_) internal virtual;

    /**
     * @notice Collateral Asset balance
     * @dev this function must be overridden by the AC implementation
     * @param account address who's Collateral Asset balance we want to know of
     * @return balance `account`'s total amount of Collateral Asset
     */
    function acBalanceOf(address account) internal view virtual returns (uint256 balance);

    // ------- Internal Functions -------

    struct MintTCParams {
        uint256 qTC;
        uint256 qACmax;
        address sender;
        address recipient;
        address vendor;
    }

    /**
     * @notice mint Collateral Token in exchange for Collateral Asset
     * @param params_ mintTCto function params
     * @dev
     *      qTC_ amount of Collateral Token to mint
     *      qACmax_ maximum amount of Collateral Asset that can be spent
     *      sender_ address who sends the Collateral Asset, all unspent amount is returned to it
     *      recipient_ address who receives the Collateral Token
     *      vendor_ address who receives a markup. If its address(0) no markup is applied
     * @return qACtotalNeeded amount of AC used to mint qTC
     * @return qFeeTokenTotalNeeded amount of Fee Token used by `sender_` to pay fees. 0 if qAC is used instead
     * @return feeCalcs platform fee detail breakdown
     */
    function _mintTCto(
        MintTCParams memory params_
    )
        internal
        notLiquidated
        notPaused
        returns (uint256 qACtotalNeeded, uint256 qFeeTokenTotalNeeded, FeeCalcs memory feeCalcs)
    {
        uint256[] memory pACtps = _getPACtps();
        // evaluates whether or not the system coverage is healthy enough to mint TC, reverts if it's not
        (uint256 lckAC, uint256 nACgain) = _evalCoverage(protThrld, pACtps);
        // calculates how many qAC are needed to mint TC
        // [N] = [N] * [PREC] / [PREC]
        uint256 qACNeededToMint = _mulPrec(params_.qTC, _getPTCac(lckAC, nACgain));
        uint256 qACSurcharges;
        (qACSurcharges, qFeeTokenTotalNeeded, feeCalcs) = _calcFees(
            params_.sender,
            params_.vendor,
            qACNeededToMint,
            tcMintFee
        );
        qACtotalNeeded = qACNeededToMint + qACSurcharges;
        if (qACtotalNeeded > params_.qACmax) revert InsufficientQacSent(params_.qACmax, qACtotalNeeded);
        // if is 0 reverts because it is trying to redeem an amount below precision
        // slither-disable-next-line incorrect-equality
        if (qACtotalNeeded == 0) revert QacNeededMustBeGreaterThanZero();
        _depositAndMintTC(params_.qTC, qACNeededToMint, params_.recipient);
        // All locked AC is either unlock or returned, no longer on pending Operation
        qACLockedInPending -= params_.qACmax;
        // transfers any AC change to the sender and distributes fees
        _distOpResults(params_.sender, params_.sender, params_.qACmax - qACtotalNeeded, params_.vendor, feeCalcs);
    }

    struct RedeemTCParams {
        uint256 qTC;
        uint256 qACmin;
        address sender;
        address recipient;
        address vendor;
    }

    /**
     * @notice redeem Collateral Asset in exchange for Collateral Token
     * @param params_ redeemTCto function params
     * @dev
     *      qTC_ amount of Collateral Token to redeem
     *      qACmin_ minimum amount of Collateral Asset that `recipient_` expects to receive
     *      sender_ address who sends the Collateral Token
     *      recipient_ address who receives the Collateral Asset
     *      vendor_ address who receives a markup. If its address(0) no markup is applied
     * @return qACtoRedeem amount of AC sent to `recipient_`
     * @return qFeeTokenTotalNeeded amount of Fee Token used by `sender_` to pay fees. 0 if qAC is used instead
     * @return feeCalcs platform fee detail breakdown
     */

    function _redeemTCto(
        RedeemTCParams memory params_
    )
        internal
        notLiquidated
        notPaused
        returns (uint256 qACtoRedeem, uint256 qFeeTokenTotalNeeded, FeeCalcs memory feeCalcs)
    {
        (uint256 ctargemaCA, uint256[] memory pACtps) = _updateEmasAndCalcCtargemaCA();
        // evaluates whether or not the system coverage is healthy enough to redeem TC
        // given the target coverage adjusted by the moving average, reverts if it's not
        (uint256 lckAC, uint256 nACgain) = _evalCoverage(ctargemaCA, pACtps);
        // evaluates if there are enough Collateral Tokens available to redeem, reverts if there are not
        _evalTCAvailableToRedeem(params_.qTC, ctargemaCA, lckAC, nACgain);
        // calculate how many total qAC are redeemed
        // [N] = [N] * [PREC] / [PREC]
        uint256 qACtotalToRedeem = _mulPrec(params_.qTC, _getPTCac(lckAC, nACgain));
        // if is 0 reverts because it is trying to redeem an amount below precision
        // slither-disable-next-line incorrect-equality
        if (qACtotalToRedeem == 0) revert QacNeededMustBeGreaterThanZero();
        uint256 qACSurcharges;
        (qACSurcharges, qFeeTokenTotalNeeded, feeCalcs) = _calcFees(
            params_.sender,
            params_.vendor,
            qACtotalToRedeem,
            tcRedeemFee
        );
        qACtoRedeem = qACtotalToRedeem - qACSurcharges;
        if (qACtoRedeem < params_.qACmin) revert QacBelowMinimumRequired(params_.qACmin, qACtoRedeem);
        _withdrawAndBurnTC(params_.qTC, qACtotalToRedeem);
        // transfers qAC to the recipient and distributes fees
        _distOpResults(params_.sender, params_.recipient, qACtoRedeem, params_.vendor, feeCalcs);
    }

    struct MintTPParams {
        address tp;
        uint256 qTP;
        uint256 qACmax;
        address sender;
        address recipient;
        address vendor;
    }

    /**
     * @notice mint Pegged Token in exchange for Collateral Asset
     * @param params_ mint TP function params
     * @dev
     *      i_ Pegged Token index
     *      qTP_ amount of Pegged Token to mint
     *      qACmax_ maximum amount of Collateral Asset that can be spent
     *      sender_ address who sends the Collateral Asset, all unspent amount is returned to it
     *      recipient_ address who receives the Pegged Token
     *      vendor_ address who receives a markup. If its address(0) no markup is applied
     * @return qACtotalNeeded amount of AC used to mint qTP
     * @return qFeeTokenTotalNeeded amount of Fee Token used by `sender_` to pay fees. 0 if qAC is used instead
     * @return feeCalcs platform fee detail breakdown
     */
    function _mintTPto(
        MintTPParams memory params_
    )
        internal
        notLiquidated
        notPaused
        returns (uint256 qACtotalNeeded, uint256 qFeeTokenTotalNeeded, FeeCalcs memory feeCalcs)
    {
        (uint256 ctargemaCA, uint256[] memory pACtps) = _updateEmasAndCalcCtargemaCA();
        uint256 i = _tpi(params_.tp);
        uint256 pACtp = pACtps[i];
        _updateTPtracking(i, pACtp);
        // evaluates whether or not the system coverage is healthy enough to mint TP
        // given the target coverage adjusted by the moving average, reverts if it's not
        (uint256 lckAC, uint256 nACgain) = _evalCoverage(ctargemaCA, pACtps);
        // evaluates if there are enough TP available to mint, reverts if it's not
        _evalTPavailableToMint(i, params_.qTP, pACtp, ctargemaCA, lckAC, nACgain);
        // calculate how many qAC are needed to mint TP
        // [N] = [N] * [PREC] / [PREC]
        uint256 qACNeededtoMint = _divPrec(params_.qTP, pACtp);
        uint256 qACSurcharges;
        (qACSurcharges, qFeeTokenTotalNeeded, feeCalcs) = _calcFees(
            params_.sender,
            params_.vendor,
            qACNeededtoMint,
            tpMintFees[params_.tp]
        );
        qACtotalNeeded = qACNeededtoMint + qACSurcharges;
        if (qACtotalNeeded > params_.qACmax) revert InsufficientQacSent(params_.qACmax, qACtotalNeeded);
        // if is 0 reverts because it is trying to mint an amount below precision
        // slither-disable-next-line incorrect-equality
        if (qACtotalNeeded == 0) revert QacNeededMustBeGreaterThanZero();
        // update flux capacitor and reverts if not allowed by accumulators
        _updateAccumulatorsOnMintTP(qACNeededtoMint);
        // update bucket and mint
        _depositAndMintTP(i, params_.qTP, qACNeededtoMint, params_.recipient);
        // All locked AC is either unlock or returned, no longer on pending Operation
        qACLockedInPending -= params_.qACmax;
        // transfers any AC change to the sender and distributes fees
        _distOpResults(params_.sender, params_.sender, params_.qACmax - qACtotalNeeded, params_.vendor, feeCalcs);
    }

    /**
     * @notice redeem Collateral Asset in exchange for Pegged Token
     * @param params_ redeem CA function parameters
     * @dev
     *      i_ Pegged Token index
     *      qTP_ amount of Pegged Token to redeem
     *      qACmin_ minimum amount of Collateral Asset that `recipient_` expects to receive
     *      sender_ address who sends the Pegged Token
     *      recipient_ address who receives the Collateral Asset
     *      vendor_ address who receives a markup. If its address(0) no markup is applied
     * @return qACtoRedeem amount of AC sent to `recipient_`
     * @return qFeeTokenTotalNeeded amount of Fee Token used by `sender_` to pay fees. 0 if qAC is used instead
     * @return feeCalcs platform fee detail breakdown
     */
    function _redeemTPto(
        RedeemTPParams memory params_
    )
        internal
        notLiquidated
        notPaused
        returns (uint256 qACtoRedeem, uint256 qFeeTokenTotalNeeded, FeeCalcs memory feeCalcs)
    {
        uint256[] memory pACtps = _getPACtps();
        uint256 i = _tpi(params_.tp);
        uint256 pACtp = pACtps[i];
        _updateTPtracking(i, pACtp);
        // evaluates whether or not the system coverage is healthy enough to redeem TP, reverts if it's not
        _evalCoverage(protThrld, pACtps);
        // calculate how many total qAC are redeemed
        // [N] = [N] * [PREC] / [PREC]
        uint256 qACtotalToRedeem = _divPrec(params_.qTP, pACtp);
        uint256 qACSurcharges;
        (qACSurcharges, qFeeTokenTotalNeeded, feeCalcs) = _calcFees(
            params_.sender,
            params_.vendor,
            qACtotalToRedeem,
            tpRedeemFees[params_.tp]
        );
        qACtoRedeem = qACtotalToRedeem - qACSurcharges;
        // if is 0 reverts because it is trying to redeem an amount below precision
        // slither-disable-next-line incorrect-equality
        if (qACtotalToRedeem == 0) revert QacNeededMustBeGreaterThanZero();
        if (qACtoRedeem < params_.qACmin) revert QacBelowMinimumRequired(params_.qACmin, qACtoRedeem);
        // update flux capacitor and reverts if not allowed by accumulators
        _updateAccumulatorsOnRedeemTP(qACtoRedeem);
        _withdrawAndBurnTP(i, params_.qTP, qACtotalToRedeem);
        // transfers qAC to the recipient and distributes fees
        _distOpResults(params_.sender, params_.recipient, qACtoRedeem, params_.vendor, feeCalcs);
    }

